import React from 'react';

function DetailedWeather(props){


	return (
		<div className="details">
			<h2>{props.store.name}</h2>
			<p>
				temp: {props.store.temp} <br />
				temp min: {props.store.tempMin} <br />
				temp max: {props.store.tempMax} <br />
				pressure: {props.store.pressure} <br />
				humidity: {props.store.humidity} <br />
				sunrise: {props.store.sunrise} <br />
				sunset: {props.store.sunset} <br />
				description: {props.store.description} <br />
				wind speed: {props.store.windSpeed}
			</p>
		</div>
	);
}

export default DetailedWeather;
